import React from "react";
import { useLocation } from 'react-router-dom';
import './home.css';

function Home (){
    const location = useLocation();
    const [data, setData] = useState(null);

    useEffect(() => {
        // Fetch data from the backend API endpoint
        axios.get("http://localhost:8000/data")
            .then(response => {
                setData(response.data);
            })
            .catch(error => {
                console.error("Error fetching data:", error);
            });
    }, []);

    return (
        <div className="container">
            <div className="box">
                <div style={{textAlign: "center"}}>Connected Devices: <br />
                    <span>{location.state.connected}</span>
                </div>
                <div className="right">Network Device Name: <br /> <span>{location.state.network}</span></div>
                <div className="left"><span>{location.state.name}</span></div>
            </div>
            <div className="div1">
                <div>
                    <p><i className="fa-solid fa-wallet" style={{color: "orange"}}></i> Curent Balance: <span>{location.state.currentBalance}</span></p>
                    <p><i className="fa-solid fa-coins" style={{color: "orange"}}></i> Amount Due: Ksh <span>{location.state.Amount}</span></p>
                </div>
                <div>
                    <p><i className="fa-solid fa-check fa-lg" style={{color: "#2fb90c"}} ></i> Payment Status: <span>{location.state.payment}</span></p>
                </div>
            </div>
            <div className="div2">
                <p>Current Package</p>
                <div className="net">
                    <div>
                        <p className="span"><span>{location.state.networkSpeed}</span></p>
                        <p>Network Speed</p>
                    </div>
                    <div className="line"></div>
                    <div>
                        <p className="span"><span id="remainingDays">{location.state.Remaining}</span> Days</p>
                        <p id="expiryDate">Expires on: <span id="expiryDateValue">{location.state.subscription}</span></p>
                    </div>
                </div>
            </div>
            <div className="div3">
                <div>
                    <p><i className="fa-solid fa-signal" style={{color: "#dcedf9"}}></i> Signal Strength </p>
                    <p className="dbm">{location.state.signal}</p>
                </div>
            </div>
            <div className="net">
                <a href="https://wa.me/+254772809396" target="_blank" rel="noopener noreferrer">Chat with us on WhatsApp</a>
                <a href="/" className="button">Log out</a>
            </div>
        </div>
    );
}

export default Home;
